/* global OMDb, RottenTomatoes */
(()=>{this.Ratings=class{constructor(M={}){if(!M.omdb_apikey)throw new Error("OMDb API Key is required");if(!M.cache_period)throw new Error("Cache Period is required");this._config={omdb_apikey:M.omdb_apikey,omdb_url:M.omdb_url||"https://www.omdbapi.com",tomato_url:M.tomato_url||"https://www.rottentomatoes.com",cache_period:M.cache_period,debug:M.debug||!1},this._debug=(M=>{this._config.debug&&console.log(M)}),this._omdb=new OMDb({apikey:this._config.omdb_apikey,url:this._config.omdb_url,debug:this._config.debug}),this._tomato=new RottenTomatoes({url:this._config.tomato_url,debug:this._config.debug}),this._logos={imdb:"data:image/svg+xml;base64,",metacritic:"data:image/svg+xml;base64,",rotten:"data:image/svg+xml;base64,",fresh:"data:image/svg+xml;base64,"},this._imdbVotes=(M=>M>=1e3?`${Math.round(M/1e3,1)}k`:M),this._tomatoLogo=(M=>M<60?this._logos.rotten:this._logos.fresh),this._tomatoScore=(M=>M<60?"Rotten":"Fresh"),this._color=(M=>M<40?"#ff0000":M>=40&&M<=60?"#ffcc33":"#66cc33")}async get(M){const N=await GM.getValue(M);// get cache
try{return await new Promise((D,I)=>{if(void 0!==N&&Date.now()-N.time<this._config.cache_period&&!this._config.debug){// cache valid
const I={omdb:N.data.omdb,tomato:N.data.tomato};// cached data
console.log(`${M} data from cache`),this._debug(I),D(I)}else// cache not valid
this._omdb.get({id:M}).then(N=>{const I=N,j=I.Title,L=Number.parseInt(/\d{4}/.exec(I.Year)[0]),g=I.Type,w=I.tomatoURL;this._tomato.search({query:j,type:g}).then(N=>{const g=N.map(M=>M).find(M=>new RegExp(M.url).test(w)||M.title===j&&(M.year?M.year:M.startYear)===L),z={omdb:I,tomato:g};// APIs data
this._config.debug||GM.setValue(M,{data:z,time:Date.now()}),// set cache
console.log(`${M} data from APIs`),this._debug(z),D(z)}// resolve data
).catch(M=>console.error(M))})})}catch(M){return console.error(M)}}async elaborate(M){try{return await new Promise((N,D)=>{const I={imdb:{logo:this._logos.imdb,rating:M.omdb&&M.omdb.imdbRating&&"N/A"!==M.omdb.imdbRating?Number(M.omdb.imdbRating):"N/A",source:"imdb",symbol:"/10",url:M.omdb&&M.omdb.imdbID?`https://www.imdb.com/title/${M.omdb.imdbID}/`:"N/A",votes:M.omdb&&M.omdb.imdbVotes&&"N/A"!==M.omdb.imdbVotes?this._imdbVotes(Number(M.omdb.imdbVotes.replace(/,/g,""))):"N/A"},tomatometer:{logo:M.tomato&&M.tomato.meterScore?this._tomatoLogo(Number(M.tomato.meterScore)):this._logos.rotten,rating:M.tomato&&M.tomato.meterScore?Number(M.tomato.meterScore):"N/A",source:"tomatometer",symbol:"%",url:M.tomato&&M.tomato.url?`https://www.rottentomatoes.com${M.tomato.url}/`:"N/A",votes:M.tomato&&M.tomato.meterScore?this._tomatoScore(Number(M.tomato.meterScore)):"N/A"},metascore:{logo:this._logos.metacritic,rating:M.omdb&&M.omdb.Metascore&&"N/A"!==M.omdb.Metascore?Number(M.omdb.Metascore):"N/A",source:"metascore",symbol:"",url:M.omdb&&M.omdb.Title?`https://www.metacritic.com/search/${"series"===M.omdb.Type?"tv":M.omdb.Type}/${encodeURIComponent(M.omdb.Title)}/results`:"N/A",votes:M.omdb&&M.omdb.Metascore&&"N/A"!==M.omdb.Metascore?this._color(Number(M.omdb.Metascore)):"N/A"}};this._debug(I),N(I)})}catch(M){return console.error(M)}}}})();